    [],nt"revision_timestamp": "2015-01-28T18:07:36.148715",nt"name": "easements-forest-conservation-act-easements",nt"isopen":
    false,nt"url": null,nt"notes": "The Forest Conservation Act of 1991 requires
    units of local government with planning and zoning authority to establish and implement
    local forest conservation programs, and provides for the Department of Natural Resources
    (DNR) administration of forest conservation requirements. During the 2008 Legislative
    Session, HB972 was adopted which effected the Forest Conservation Act's reporting
    and enforcement requirements. On or before July 1st of each year, the DNR shall
    submit to the Senate Education, Health, and Environmental Affairs Committee and
    the House Environmental Matters Committee a statewide report compiled from local
    authorities. Included with this report DNR will also be required to submit, to the
    best practicable extent, the size shape and location of all conserved and planted
    forest areas submitted in an electronic geographic information system or other similar
    computer aided design format.",nt"license_title": null,nt"extras": [{ntt"key":
